import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';

import 'bootstrap/dist/css/bootstrap.min.css';

import Navbar from './components/Navbar';
import Sidebar from './components/Sidebar';
import Applet from './components/Applet';
import Footer from './components/Footer';

import './styles/App.css';

export function ParentComponent() {
  const [sharedState, setSharedState] = useState('Initial Value');

  return (
    <div>
      <Navbar sharedState={sharedState} setSharedState={setSharedState} />
      <Applet sharedState={sharedState} setSharedState={setSharedState} />
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

    <>

        <Navbar />

        {/* MAIN APPLET */}
        <div id="applet-window" className="container-fluid">
          <div className="row h-100">
            <Sidebar />
            <Applet />
          </div>
        </div>

        <Footer />

    </>

);
